/******************************************************************************
 * Interrupt Service Routine
 * Determines what caused the interrupt and calls the appropriate
 * subroutine.
 *
 * ipending - Control register 4 which has the pending external interrupts
 ******************************************************************************/
void interrupt_handler(void) {
    int ipending;
    NIOS2_READ_IPENDING(ipending);
    if (ipending & 0x1)  // interval timer is interrupt level 0
    {
        interval_timer_ISR(&game);
    }
    if (ipending & 0x80)  // PS/2 is interrupt level 7
    {
        ps2_ISR(&game);
    }
    // else, ignore the interrupt
    return;
}

void interval_timer_ISR(Game *game) {
    printf("Current time: %d\n", game->currentRound.currentTime);
    volatile int *interval_timer_ptr = (int *)TIMER_BASE;
    *(interval_timer_ptr) = 0;                 // clear the interrupt
    game->currentRound.currentTime += 1;                    // increment the time
	
	if (game->currentBall.isMoving) {
		// increment the projTime every sec when the ball is moving
		game->currentBall.projTime += 1;
	}
    return;
}

void ps2_ISR(Game *game) {
    volatile int *PS2_ptr = (int *)PS2_BASE;
    int PS2_data, RVALID, RAVAIL, interrupt;
    PS2_data = *(PS2_ptr);  // read the Data register in the PS/2 port

    // read the control register
    interrupt = *(PS2_ptr + 1);

    // Clear Interrupt
    *(PS2_ptr + 1) = interrupt;

    RVALID = PS2_data & 0x8000;    // extract the RVALID field
    RAVAIL = PS2_data & 0xFF0000;  // extract the RAVAIL field

    if (RAVAIL > 0) {
        // printf("keyboard interrupt\n");
    }

    if (RVALID) {
        /* shift the next data byte into the display */
        byte1 = byte2;
        byte2 = byte3;
        byte3 = PS2_data & 0xFF;

        // find the key that was pressed
        pressedKey = byte3;

        keyPressed = true;

    } else {
        pressedKey = 0;
        keyPressed = false;
    }

    return;
}

