// Update the game state based on the current state and set initial screen for each state
void updateState(Game *game) {
    volatile int *interval_timer_ptr = (int *)TIMER_BASE;  // interal timer base address
    game->previousState = game->currentState;              // Save the previous state

    clear_screen();  // Clear the screen, will remove this later to imrpove performance
    printf("Pressed key: %d \n", pressedKey);
    switch (game->currentState) {
        case INITIALIZING:

            // printf("Game initialized\n");
            draw_image(basketblitz, (Position){0, 0}, 320, 240);

            // Transition to the playing state when the spacebar is pressed
            if (pressedKey == SPACEBAR) {
                game->currentState = TUTORIAL;
                clear_screen();
            }

            break;

        case TUTORIAL:
            draw_image(basketBlitzTutorial, (Position){0, 0}, 320, 240);

            // Transition to the playing state when the spacebar is pressed
            if (pressedKey == ENTER) {
                keyPressed = false;
                game->currentState = SETUP_ROUND1;
                draw_image(round1, (Position){0, 0}, 320, 240);
            }

            break;

        case SETUP_ROUND1:

            initializeRound1(game);
            game->currentState = PLAYING_ROUND1;

            break;

        case PLAYING_ROUND1:

            // printf("Round 1 Playing\n");

            // print the score of the current player
            printf("player %d score is: %d \n", game->currentRound.roundNumber, &game->currentRound.playerTurn.score);

            draw_basketball(&game->currentBall, 0xFFFF, true);
            draw_image(basketballhoop, game->hoop.currentPos, game->hoop.bounds.x, game->hoop.bounds.y);  // Draw basketball hoop

            // only show projectile when the ball is static
            if (!(game->currentBall.isMoving)) {
                drawProjectile(game);
            }
			
            // Transition to the game over state when the game is over
            if (game->currentRound.currentTime >= game->currentRound.maxTime) {
                game->currentRound.isRoundOver = true;
                game->currentState = SETUP_ROUND2;
                draw_image(round2, (Position){0, 0}, 320, 240);
				
				// release the ball
			} else if (pressedKey == SPACEBAR && keyPressed) {
                keyPressed = false;
				printf("ball should move\n");
				game->currentBall.isMoving = true;

				// set the ball position
            } else if (pressedKey == W && game->currentBall.currentPos.y < Y_DIM && keyPressed) {
				keyPressed = false;
                game->currentBall.currentPos.y += 1;
            } else if (pressedKey == S && game->currentBall.currentPos.y > 0 && keyPressed) {
				keyPressed = false;
                game->currentBall.currentPos.y -= 1;
            } else if (pressedKey == A && game->currentBall.currentPos.x > 0 && keyPressed) {
				keyPressed = false;
                game->currentBall.currentPos.x -= 1;
            } else if (pressedKey == D && game->currentBall.currentPos.x < X_DIM && keyPressed) {
				keyPressed = false;
                game->currentBall.currentPos.x += 1;
				
				// set the angle of projection
			} else if (pressedKey == UP && game->currentBall.currentAngle < MAX_ANGLE && keyPressed) {
				keyPressed = false;
				game->currentBall.currentAngle += halfRadian;
				updateVelocity(&game->currentBall);
			} else if (pressedKey == DOWN && game->currentBall.currentAngle > MIN_ANGLE && keyPressed) {
				keyPressed = false;
				game->currentBall.currentAngle -= halfRadian;
				updateVelocity(&game->currentBall);
			}
			
			updateGame(game, 0);  // one second passes between each cycle
			
            break;

        case SETUP_ROUND2:

            initializeRound2(game);
            game->currentState = PLAYING_ROUND2;

            break;

        case PLAYING_ROUND2:

            // printf("Round 2 Playing\n");

            // print the score of the current player
            printf("player %d score is: %d \n", game->currentRound.roundNumber, &game->currentRound.playerTurn.score);

            draw_basketball(&game->currentBall, 0xFFFF, true);
            draw_image(basketballhoop, game->hoop.currentPos, game->hoop.bounds.x, game->hoop.bounds.y);  // Draw basketball hoop

            // only show projectile when the ball is static
            if (!(game->currentBall.isMoving)) {
                drawProjectile(game);
            }
			
            // Transition to the game over state when the game is over
            if (game->currentRound.currentTime >= game->currentRound.maxTime) {
                game->currentRound.isRoundOver = true;
                game->currentState = GAME_OVER;
                draw_image(round2, (Position){0, 0}, 320, 240);
				
				// release the ball
			} else if (pressedKey == SPACEBAR && keyPressed) {
                keyPressed = false;
				printf("ball should move\n");
				game->currentBall.isMoving = true;
                
				// set the ball position
            } else if (pressedKey == W && game->currentBall.currentPos.y < Y_DIM && keyPressed) {
				keyPressed = false;
                game->currentBall.currentPos.y += 1;
            } else if (pressedKey == S && game->currentBall.currentPos.y > 0 && keyPressed) {
				keyPressed = false;
                game->currentBall.currentPos.y -= 1;
            } else if (pressedKey == A && game->currentBall.currentPos.x > 0 && keyPressed) {
				keyPressed = false;
                game->currentBall.currentPos.x -= 1;
            } else if (pressedKey == D && game->currentBall.currentPos.x < X_DIM && keyPressed) {
				keyPressed = false;
                game->currentBall.currentPos.x += 1;
				
				// set the angle of projection
			} else if (pressedKey == UP && game->currentBall.currentAngle < MAX_ANGLE && keyPressed) {
				keyPressed = false;
				game->currentBall.currentAngle += halfRadian;
				updateVelocity(&game->currentBall);
			} else if (pressedKey == DOWN && game->currentBall.currentAngle > MIN_ANGLE && keyPressed) {
				keyPressed = false;
				game->currentBall.currentAngle -= halfRadian;
				updateVelocity(&game->currentBall);
			
            // power up the ball so it moves faster
            } else if (pressedKey == RIGHT && keyPressed) {
                keyPressed = false;
                game->currentBall.currentVel.v0 += faster;
                updateVelocity(&game->currentBall);
            
            // power down the ball so it moves slower
            } else if (pressedKey == RIGHT && keyPressed) {
                keyPressed = false;
                game->currentBall.currentVel.v0 -= faster;
                updateVelocity(&game->currentBall);
            } 
			updateGame(game, 0);  // one second passes between each cycle
			
            break;

        case GAME_OVER:

            // printf("Game over\n");

            draw_image(gameover, (Position){0, 0}, 320, 240);

            // Transition to the initializing state when the spacebar is pressed
            if (pressedKey == ESC) {
                game->previousState = GAME_OVER;
                game->currentState = INITIALIZING;
                // Reset the game
                initializeGame(game);
            }

            break;
    }
    clearKeyboardBuffer();  // Prevents the game from registering multiple key presses and overflowing the buffer
    // Note bufer overflow is not a problem on the DE1-SoC, but it is good practice to clear the buffer
    // waitASec();  // Wait a second before updating the game state
}

